// src/utils/fonts.ts

// ✅ Inter Regular ve Bold fontlarını base64 olarak import edin
// (Yukarıdaki komutla oluşturduğunuz base64 string'leri buraya yapıştırın)

export const INTER_REGULAR_BASE64 = ""
; // inter-regular-base64.txt içeriği"; 
export const INTER_BOLD_BASE64 = ""
// Inter fontlarının base64 kodları";

export function addInterFontsToJsPDF(doc: any) {
  try {
    // Regular font ekle
    doc.addFileToVFS("Inter-Regular.ttf", INTER_REGULAR_BASE64);
    doc.addFont("Inter-Regular.ttf", "Inter", "normal");
    
    // Bold font ekle
    doc.addFileToVFS("Inter-Bold.ttf", INTER_BOLD_BASE64);
    doc.addFont("Inter-Bold.ttf", "Inter", "bold");
    
    console.log("✅ Inter fontları başarıyla yüklendi");
    return true;
  } catch (error) {
    console.error("❌ Font yükleme hatası:", error);
    return false;
  }
}